package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import java.time.LocalDate;
import static org.junit.jupiter.api.Assertions.*;
import java.util.Arrays;
import org.springframework.samples.petclinic.vet.Vet;
import org.springframework.samples.petclinic.vet.Specialty;
import java.util.List;

class VetTest {

	private Vet instance;

	@BeforeEach
	void setUp() {
		instance = new Vet();
	}

	@Test
	@DisplayName("Verifies that when specialties is not null, the method returns the existing set")
	void testGetSpecialtiesInternalReturnsExistingSet() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verifies that when specialties is null, the method initializes it to a new empty HashSet and returns it")
	void testGetSpecialtiesInternalInitializesNewSetWhenNull() {
		var result = instance.getSpecialtiesInternal();
		assertNotNull(result);
	}

	@Test
	@DisplayName("Verify that getSpecialties returns the list of specialties sorted by name when multiple specialties exist")
	void testGetSpecialtiesReturnsSortedList() {
		var cardiology = new Specialty();
		var dentistry = new Specialty();
		instance.addSpecialty(cardiology);
		instance.addSpecialty(dentistry);
		var result = instance.getSpecialties();
		assertEquals(Arrays.asList(cardiology, dentistry), result);
	}

	@Test
	@DisplayName("Verify that getSpecialties returns an empty list when no specialties have been added")
	void testGetSpecialtiesReturnsEmptyList() {
		var result = instance.getSpecialties();
		assertEquals(Arrays.asList(), result);
	}

	@Test
	@DisplayName("Verify that getSpecialties returns a list containing the single specialty when only one exists")
	void testGetSpecialtiesWithOneSpecialty() {
		var cardiology = new Specialty();
		instance.addSpecialty(cardiology);
		var result = instance.getSpecialties();
		assertEquals(Arrays.asList(cardiology), result);
	}

}
